CREATE TEMPORARY TABLE match_events (
  id bigserial,
  f_match int8,
  half int2,
  second numeric,
  c_action int4,
  props jsonb,
  f_team int4,
  f_player int4,
  opponent_f_team int4,
  opponent_f_player float8
);



CREATE TEMPORARY TABLE c_action(
  id int,
  name VARCHAR(50)
);




CREATE TEMPORARY TABLE f_player (
  id int,
  firstname_eng varchar(100),
  lastname_eng varchar(100)
);



CREATE TEMPORARY TABLE f_team (
  id int,
  name_eng varchar(100)
);







-- вывод событий матча

SELECT
	me.id
	,me.f_team
    ,t.name_eng as team_name
    ,me.f_player
    ,p.firstname_eng || ' ' || p.lastname_eng as player_name
    ,me.c_action
    ,a.name as action_name
    ,me.opponent_f_team
    ,t_opp.name_eng as opponent_team_name
    ,me.opponent_f_player
    ,p_opp.firstname_eng || ' ' || p_opp.lastname_eng as opponent_player_name
    ,me.props
FROM
	match_events me
	LEFT JOIN f_team t
	  ON t.id = me.f_team
	LEFT JOIN f_player p
	  ON p.id = me.f_player
	LEFT JOIN c_action a
	  ON a.id = me.c_action
	LEFT JOIN f_team t_opp
	  ON t_opp.id = me.opponent_f_team
	LEFT JOIN f_player p_opp
	  ON p_opp.id = me.opponent_f_player
;


/*
Данные в поле "props" записаны по принципу "id_свойства": [массив_значений], "id_свойства": [массив_значений], ...

Свойства и их значения:

Свойство 2 - часть тела
Значения:
